import React from 'react';

function Home() {
  return (
    <div className="stack" style={{ '--stacks': 3 }}>
      <span style={{ '--index': 0 }}>Gde sad</span>
      <span style={{ '--index': 1 }}>Gde sad</span>
      <span style={{ '--index': 2 }}>Gde sad</span>
    </div>
  );
}

export default Home;
